  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Blackwater NWR
  outlines Refuge accomplishments from May through August of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and collections and receipts. Resource management is outlined;
  topics include commercial fishing. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  Refuge visitors and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
